requestMetaInfo.preRequestScript:
function handleRequestParams(requestParam){
                var salt="9sgs8d9wejwet8we";
                var sign=requestParam.getString("sign").toLowerCase();
                var sid=requestParam.getString("sid");
                if (hex_md5(hex_md5(sid).toUpperCase()+salt).toLowerCase() != sign){
                return "-1";
                }
                return sid;
                }

